import React, {useState, useEffect } from 'react'
import Axios from 'axios';
import './Contact.css';
function Contact() {
  	

    const[name, setname] = useState('');
    const[email, setemail] = useState('');
    const[message, setmessage] = useState('');
    
  
    
  
    var handleSubmit = () =>{
      Axios.post('http://localhost:3456/api/insert', {name: name, email:email, message:message}).then(()=>{
          alert("success")
      });
      
      
    };
    
    return (
        <div>
        <div className="form text-center" >
            <h1>Contact Us</h1>
            <p>Leave us a Message :</p>
            <form onSubmit={handleSubmit} className="form_fill">
                
                <label>name :</label><input type="text" className="g"  placeholder=" name..." name="name" onChange={(e)=>{setname(e.target.value)}} required />
                <label>email :</label><input type="text" className="h"  placeholder=" email..." name="email" onChange={(e)=>{setemail(e.target.value)}} required />
                <label>message : </label><input type="text" className="j"  placeholder="message..." name="message" onChange={(e)=>{setmessage(e.target.value)}} required />
                <button type="submit" className="btn btn-primary">Submit</button>
                <br/>
            </form>

         
        </div>
        </div>
    )
}

export default Contact;

